static unsigned long milli_time() // copied from JSolve.c
{
  struct rusage usage;

  if (getrusage(RUSAGE_SELF,&usage)>=0)
    return usage.ru_utime.tv_sec*1000+usage.ru_utime.tv_usec/1000;
  return 0;
}

inline bool is_pow_of_2(uint16_t x) {
  return ((x != 0) && ((x & (~x + 1)) == x));
}

#if defined(__i686__) || defined(__x86_64__)
inline uint8_t get_msb_pos(uint16_t n) {
  uint16_t msb;
  uint16_t ni = n;
  asm("bsrw %1,%0" : "=r"(msb) : "r"(ni));
  return static_cast<uint8_t>(msb);
}

inline uint8_t get_msb_pos(uint32_t n) {
  uint32_t msb;
  asm("bsrl %1,%0" : "=r"(msb) : "r"(n));
  return static_cast<uint8_t>(msb);
}
#else
inline uint8_t get_msb_pos(uint16_t n) {
  return msbs[n];
}
inline uint8_t get_msb_pos(uint32_t n) {
  uint8_t ret = msbs[n >> 16];
  if (ret == 0) {
    return msbs[n & 0xFFFF];
  } else {
    return ret + 16;
  }
}
#endif

template <typename T, int N, typename SizeT = int>
struct bounded_stack {
  T data[N];
  SizeT len;

  bounded_stack() : len(0) {
  }

  T& top() {
#ifndef NDEBUG
    if (len == 0) {
      std::fprintf(stderr, "trying to obtain top of empty stack");
      std::exit(1);
    }
#endif
    return data[len - 1];
  }

  T& next() { // dangerous shortcut for performance
    return data[len];
  }
  void push_next() {
    ++ len;
  }

  void pop() {
#ifndef NDEBUG
    if (len == 0) {
      std::fprintf(stderr, "attempted to pop empty stack");
      std::exit(1);
    }
#endif
    -- len;
  }
  void push(const T& v) {
    data[len] = v;
    //::memcpy(data + len, &v, sizeof(T));
    ++ len;
#ifndef NDEBUG
    if (len > N) {
      std::fprintf(stderr, "bound error in bounded stack %d >= %d", len, N);
      std::exit(1);
    }
#endif
  }
  size_t size() const { return len; }
  bool empty() const { return len == 0; }
  void clear() { len = 0; }
};

template <typename T, int N, typename SizeT=int>
struct bounded_queue {
  T data[N];
  SizeT off, end, len;

  bounded_queue() : off(0), end(0), len(0) {
  }

  T& front() { return data[off]; }
  T& next() { return data[end]; }
  void push_next() {
    ++ len;
    ++ end;
    if (end >= N) end -= N;
  }

  void pop(int n) {
    off += n;
    if (off >= N) off -= N;
    len -= n;
  }

  void pop_front() {
    ++ off;
    if (off >= N) off -= N;
    -- len;
#ifndef NDEBUG
    if (len < 0) {
      std::fprintf(stderr, "attempted to pop empty queue");
      std::exit(1);
    }
#endif
  }
  void push_back(const T& v) {
    data[end] = v;
    ++ len;
    ++ end;
    if (end >= N) end -= N;
#ifndef NDEBUG
    if (len > N) {
      std::fprintf(stderr, "bound error in bounded queue %d >= %d\n", len, N);
      std::exit(1);
    }
#endif
  }


  size_t size() const { return len; }
  void clear() {
    len = 0;
    off = 0;
    end = 0;
  }
};
